description:
Recently sold: $570,000. Our home was built in 2004 on 0.51 acres of land. The lot size is 144' wide by 150' deep. Our home is centrally located in Duluth, MN just 5 minutes from the downtown area and 5 minutes away from the Miller Hill Mall. Enjoy the city COGGS biking and walking trails beginning just 500' from our front door. Our home was built using 2 x 6 construction and has a living space of 3025' sq. ft. The main level boasts 9' ceilings, a spacious master bedroom suite with double vanities, walk in closet, jetted bathtub and a walk in shower. The  laundry room is conveniently located on the main level and includes a new Electrolux washer and dryer. An Electrolux central vac system is provided throughout the home, including a dust pan within the kitchen. The main level floor incorporates Gypcrete and a Wars Bow heating system. The home is divided into 5 heating zones and includes two 24' by 24' heated attached garages. A gas fireplace is located in the open living area and there are two, split-system air conditioners, one in the living area and one in the master bedroom. The kitchen incorporates under cabinet lighting, red birch cabinets, black granite countertops, stainless steel appliances, gas stove, trash compactor, and a large eat at island. A planning center adjacent to the dining area also provides additional buffet space for entertaining.&nbsp;
The lower level living space includes two bedrooms, full bath, sauna, exercise room, utility/storage room (air exchanger, boiler-mate), and an extensive wet bar entertainment area.&nbsp;
A security system monitors all windows and doors and incorporates motion detectors both on the main level and lower living area.
740 sq. ft of Trex decking with glass railings run the entire length of the home providing panoramic views of Lake Superior, Park Point and the St Louis Bay. A six person Beachcomber hot tub is just one of the special features incorporated in the outdoor living area of the deck. South facing windows provide an excellent source of passive solar heat to all areas of the home. The driveway and sidewalks are constructed using paver stones and the lower garage driveway is asphalt.
